import React, { useState } from "react";
import "./Faq.css";

const HelpCenter = () => {
  const [activeSection, setActiveSection] = useState("buying");

  const renderContent = () => {
    switch (activeSection) {
      case "buying":
        return (
          <div className="content-box">
            <h2>Buying</h2>
            <p>
              Learn how to purchase items, track orders, and handle returns on WhatNew.
            </p>
          </div>
        );
      case "account":
        return (
          <div className="content-box">
            <h2>Account</h2>
            <p>
              Manage your profile, update personal details, and secure your account.
            </p>
          </div>
        );
      case "selling":
        return (
          <div className="content-box">
            <h2>Selling</h2>
            <p>
              Discover how to list products, manage inventory, and earn more by selling on WhatNew.
            </p>
          </div>
        );
      case "safety":
        return (
          <div className="content-box">
            <h2>Safety</h2>
            <p>
              Stay safe while buying and selling with our community safety guidelines.
            </p>
          </div>
        );
      case "policy":
        return (
          <div className="content-box">
            <h2>Policy</h2>
            <p>
              Review our refund, privacy, and content policies to understand your rights.
            </p>
          </div>
        );
      default:
        return null;
    }
  };

  return (
    <div className="help-center">
      <h1 className="help-title">Help Center</h1>

      <div className="button-row">
        <button
          className={activeSection === "buying" ? "active" : ""}
          onClick={() => setActiveSection("buying")}
        >
          Buying
        </button>
        <button
          className={activeSection === "account" ? "active" : ""}
          onClick={() => setActiveSection("account")}
        >
          Account
        </button>
        <button
          className={activeSection === "selling" ? "active" : ""}
          onClick={() => setActiveSection("selling")}
        >
          Selling
        </button>
        <button
          className={activeSection === "safety" ? "active" : ""}
          onClick={() => setActiveSection("safety")}
        >
          Safety
        </button>
        <button
          className={activeSection === "policy" ? "active" : ""}
          onClick={() => setActiveSection("policy")}
        >
          Policy
        </button>
      </div>

      <div className="content-container">{renderContent()}</div>
    </div>
  );
};

export default HelpCenter;
